request.description:
Para realizar a edição de uma boleta é necessário seguir os seguintes passos:  

1º) Fazer o GET da boleta que deseja editar;  
2º) Com o objeto da boleta em mãos, atualizar os parâmetros que deseja realizar a edição desta boleta;  
3º) Enviar esse mesmo objeto editado para o endpoint "Edição de boleta" informando o ID da mesma na URL;

